import {useState} from 'react'
import EmloyeeItem from './EmployeeItem';

const data = [
    {
        id: "test_1", 
        f_name: "test_1", 
        l_name: "test_1", 
        email: "test_1"
    }, 
    {
        id: "test_2", 
        f_name: "test_2", 
        l_name: "test_2", 
        email: "test_2"
    }, 
    {
        id: "test_3", 
        f_name: "test_3", 
        l_name: "test_3", 
        email: "test_3"
    }

]

function EmloyeesList(props) {

const [employees, setEmployees] = useState(data);

    return (
        <div>
            {employees.map(employee => 
            <li>
                <EmloyeeItem 
                id={employee.id} 
                f_name={employee.f_name} 
                l_name={employee.l_name} 
                email={employee.email} />
            </li>        
            )}
        </div>
    )
}

export default EmloyeesList;
